import React from 'react';
import { View, Text, Image, StyleSheet, Dimensions } from 'react-native';




export function Home({ navigation }) {

  const screenWidth = Dimensions.get('window').width;
  const isDesktop = screenWidth > 800;  

    return (
        <View style={styles.titleMobile}>
            <Text style={styles.headerText}>Kathariana</Text>
            <Text style={styles.headerText}>&</Text>
            <Text style={styles.headerText}>Patrick</Text>
            <View style={styles.imageContainer}>
                <Image source={require('../assets/placholder.jpeg')} style={styles.mainImage} />
                <Image source={require('../assets/framegold.png')} style={styles.frameImage} />
            </View>
        </View>
    );
}

const styles = StyleSheet.create({
    titleMobile: {
        width: "100%",
        height: "98%",
        alignItems: 'center',
        marginTop: 10,
    },
    headerText: {
        fontFamily: 'Great Vibes',
        fontSize: 36,
        textAlign: 'center',
    },
    imageContainer: {
        position: 'relative',
        width: '85%',
        height: '70%',
        zIndex: -1,
    },
    mainImage: {
      position: 'absolute',
        top: 45,
        left: 38,
        width: isDesktop ? '50%' : '80%',
        height: isDesktop ? '50%' : '80%',
        resizeMode: 'cover',
        borderRadius: 5,
    },
    frameImage: {
        position: 'absolute',
        top: 0,
        left: 0,
        width: isDesktop ? '50%' : '100%',
      height: isDesktop ? '50%' : '100%',
        resizeMode: 'cover',
        borderRadius: 20,
        zIndex: 1,
    },
});
